import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';
import UseReducers from './components/useReducers';
import MainContext from './MainContext';
import TodoReducer from './TodoReducer';

ReactDOM.render(
  <React.StrictMode>
    <div>Counter using useState</div>
    <App />
    <div>Change theme using useContext</div>
    <MainContext />
    <div>Counter using useReducer</div>
    <UseReducers/>
    <div>Todo app using useReducer along with delete and toggle complete</div>
    <TodoReducer />
  </React.StrictMode>,
  document.getElementById('root')
);

